import React from "react";
import { useNavigate } from "react-router-dom";

const Task = ({ loggedIn }) => {
  const navigate = useNavigate();

  if (!loggedIn) {
    // If the user is not logged in, navigate to the login page
    navigate("/login");
    // You can also return null or a loading indicator while navigating
    return null;
  }

  return <div>Task</div>;
};

export default Task;
